async function jsmc(a){await fetch("https://playerdb.co/api/player/minecraft/"+a).then(a=>a.json()).then(a=>{player=new Object,player.username=a.data.player.username,player.uuid=a.data.player.id,player.id=a.data.player.raw_id,player.name_history=a.data.player.meta.name_history,player.icon=`https://crafatar.com/avatars/${player.id}?overlay`,player.avatar=`https://crafatar.com/renders/body/${player.id}?overlay`,player.head=`https://crafatar.com/renders/head/${player.id}?overlay`,player.skin=`https://crafatar.com/skins/${player.id}`,player.cape=new Object,player.cape.official=`https://crafatar.com/capes/${player.id}`,player.cape.optifine=`https://api.gapple.pw/cors/optifine/${player.username}`,player.cape.labymod=`https://api.gapple.pw/cors/labymod/cape/${player.id}`,code()})}
